import React from 'react';
import { Box, Typography } from '@mui/material';

export const Regiment: React.FC = () => {
  return (
    <Box
      maxWidth={1000}
      mx="auto"
      my={5}
      px={2}
      color="#424242"
      sx={{ minHeight: '100vh' }}
    >
      <Typography variant="h4" fontWeight="bold" mb={6} text>
        Regimento Interno
      </Typography>
      <Typography paragraph textAlign={'justify'}>
        Na Assembleia Geral Extraordinária (AGE) de 21 de setembro de 2023,
        foram debatidos novos tópicos importantes para a atualização do
        Regimento Interno (RI) do Clube Poçoscaldense de Vôo Livre - CPVL.
      </Typography>
      <Typography paragraph textAlign={'justify'}>
        O CPVL agradece a todos que contribuíram para a atualização do estatuto
        e reforça que a participação dos associados nas assembleias é de extrema
        importância, pois entende que todos têm algo a contribuir com o clube.
      </Typography>
    </Box>
  );
};
